import logo from './logo.svg';
import './App.css';
import { Row, Col, Button } from 'antd';

function App() {
  return (
    <div className="App">
      <Row justify="center">
        <Col span={8}>
          <Title></Title>
          <Button>Đăng NHẬP BẰNG GOOGLE</Button>
        </Col>
        <Col>
          <Title></Title>
          <Button>Đăng NHẬP BẰNG FACEBOOK</Button>
        </Col>
      </Row>
    </div>
  );
}

export default App;
